import React from 'react';
import { Route, Navigate } from 'react-router-dom';
import { isAuthenticated } from './component/Login';

const AuthGuard = ({ element: Element, ...rest }) => {
  return (
    <Route
      {...rest}
      element={props =>
        isAuthenticated() ? (
          <Element {...props} />
        ) : (
          <Navigate to="/" replace />
        )
      }
    />
  );
};

export default AuthGuard;
